import * as React from "react";
import {StyleSheet, Text, View } from "react-native";
import Man from "../components/Animated/Man";
function FavoritesScreen() {
  return (
    <View style={{ 
    backgroundColor:'white'}}>
      <View>
      <Man />
      </View>
    </View>
  );
}
export default FavoritesScreen;
